💥Не упусти возможность войти в десятку лучших! 

💫 Уже через неделю завершится прием заявок в образовательный проект Фонда «Будущие лидеры»! 

Ты давно мечтаешь реализовать свой лидерский потенциал, прокачать навыки в разных сферах и достичь профессиональных высот? У тебя есть идея для запуска собственного проекта? 
Тогда мы ждем тебя! 

Приглашаем студентов 1-3 курса бакалавриата или специалитета попробовать свои силы и принять участие в отборе! 

Переходи по ссылке 👉🏻 https://vk.cc/7DeoGS отправляй заявку и присоединяйся к сообществу талантливой и активной молодежи Москвы и Петербурга! 

Самых успешных кандидатов ждет: 
✔ Знакомство и общение с наставниками (в числе которых бизнесмены, топ-менеджеры, ученые, представители власти); 
✔ Мастер-классы, экскурсии, тренинги и лекции с интересными спикерами и экспертами; 
✔Поддержка и реализация собственного проекта; 
✔ Эффективный нетворкинг; 
✔ Стажировки в ведущих компаниях; 

Участие в программе Фонда бесплатное. 
Подать заявку и прочитать подробности можно на сайте http://russianleaders.org/profile/konkursnie-otbori .

Открыта регистрация на кейс-чемпионат Changellenge » Cup Technical 2020 — соревнование по решению инженерных задач из практики крупных российских и зарубежных компаний для студентов и недавних выпускников технических и бизнес-направлений.

Две секции на выбор:
— ресурсная, где вы разберетесь в преимуществах и рисках аддитивных технологий и узнаете о последних достижениях робототехники;
— производственная, где вы сможете оптимизировать производственные процессы и вывести бизнес компании на новый уровень. 

При участии вы сможете:
— получить опыт, который нельзя приобрести в университете, и прокачать основные soft skills; 
— заработать плюс к резюме: 90 % лучших работодателей России обращают внимание на участие в кейс-чемпионатах; 
— начать карьеру в одной из шести компаний-партнеров: Aggreko, P&G, НИПИГАЗе, «Норникеле», EY и Schlumberger. 

Собирайте команду или подавайте индивидуальную заявку — мы поможем подобрать единомышленников. 

Регистрация до 9 марта включительно: https://clck.ru/MBoVt
